import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import { ChevronDown, Users, BookOpen, Target, Award } from 'lucide-react';

const AboutUs = () => {
  const [activeSection, setActiveSection] = useState('mission');

  const sections = {
    mission: {
      title: "Our Mission",
      content: "EduConnect is dedicated to revolutionizing educational experiences through innovative technology. We strive to create an inclusive, collaborative environment where learning knows no bounds.",
      icon: <Target className="w-8 h-8 text-blue-600" />
    },
    community: {
      title: "Our Community",
      content: "Join thousands of students, educators, and institutions worldwide who are already part of the EduConnect family. Our diverse community drives innovation and excellence in education.",
      icon: <Users className="w-8 h-8 text-blue-600" />
    },
    approach: {
      title: "Our Approach",
      content: "We combine cutting-edge technology with proven educational methodologies to deliver an unparalleled learning experience. Our platform adapts to different learning styles and needs.",
      icon: <BookOpen className="w-8 h-8 text-blue-600" />
    },
    achievements: {
      title: "Our Achievements",
      content: "Recognized for excellence in EdTech innovation, we've helped over 100,000 students achieve their educational goals. Our platform has won multiple awards for its user-centric design.",
      icon: <Award className="w-8 h-8 text-blue-600" />
    }
  };

  return (
    <div className="min-h-screen relative bg-gradient-to-br from-purple-900 via-blue-900 to-indigo-900">
      {/* Background Image */}
      <div 
        className="absolute inset-0 bg-cover bg-center opacity-20"
        style={{
          backgroundImage: `url(${"images/background.png"})`,
          backgroundBlendMode: 'overlay'
        }}
      />

      {/* Navbar */}
      <nav className="relative z-10 bg-white/10 backdrop-blur-sm">
        <div className="max-w-7xl mx-auto px-4 py-3">
          <div className="flex justify-between items-center">
            <div className="text-white font-bold text-xl">EduConnect</div>
            <div className="space-x-4">
              <Link to="/" className="text-white hover:text-blue-300 transition">Home</Link>
              <Link to="/about" className="text-white hover:text-blue-300 transition">About</Link>
              <Link to="/contact" className="text-white hover:text-blue-300 transition">Contact</Link>
            </div>
          </div>
        </div>
      </nav>

      {/* Main Content */}
      <div className="relative z-10 max-w-7xl mx-auto px-4 py-16">
        <div className="bg-white/10 backdrop-blur-md rounded-xl p-8 shadow-xl">
          <h1 className="text-4xl font-bold text-white mb-8 text-center">
            Welcome to EduConnect
          </h1>

          {/* Interactive Sections */}
          <div className="grid md:grid-cols-2 gap-8 mb-12">
            {Object.entries(sections).map(([key, section]) => (
              <div
                key={key}
                className={`p-6 rounded-lg transition-all duration-300 cursor-pointer
                  ${activeSection === key 
                    ? 'bg-white/20 transform scale-105' 
                    : 'bg-white/5 hover:bg-white/10'}`}
                onClick={() => setActiveSection(key)}
              >
                <div className="flex items-center mb-4">
                  {section.icon}
                  <h2 className="text-xl font-semibold text-white ml-4">
                    {section.title}
                  </h2>
                </div>
                <p className="text-gray-100">
                  {section.content}
                </p>
              </div>
            ))}
          </div>

          {/* Stats Section */}
          <div className="grid grid-cols-2 md:grid-cols-4 gap-4 text-center">
            {[
              { label: 'Active Users', value: '100K+' },
              { label: 'Institutions', value: '500+' },
              { label: 'Countries', value: '50+' },
              { label: 'Success Rate', value: '95%' }
            ].map((stat, index) => (
              <div 
                key={index}
                className="bg-white/5 p-4 rounded-lg backdrop-blur-sm"
              >
                <div className="text-3xl font-bold text-blue-300">{stat.value}</div>
                <div className="text-sm text-gray-300">{stat.label}</div>
              </div>
            ))}
          </div>

          {/* CTA Section */}
          <div className="mt-12 text-center">
            <button className="bg-blue-600 hover:bg-blue-700 text-white font-bold py-3 px-8 rounded-full transition-colors duration-300">
              Join Our Community
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default AboutUs;
